import './navbar.css';
import { Link } from 'react-router-dom';

function NavBar() {
  return (
    <div>
    <nav>
        <div class="boox">
          <Link to="/" class="item">Pagina inicio</Link>
          <Link to="/profesor" class="item">Profesores</Link>
          <Link to="/materias" class="item">Materias</Link>
          <Link to="/horario" class="item">Horario</Link>
          <Link to="/repositorio" class="item">Repositorio</Link>
        </div>  

            <img src="data:image/png;base64,"/>
    </nav>
    </div>
  );
}

export default NavBar;
